import React from "react";
import link from "react-router-dom";
import "../styles/Beranda.css";

function Beranda() {
  return (
    <div>
      <h1>Selamat Datang di Beranda</h1>
      <p>Ini adalah halaman beranda setelah login.</p>
    </div>
  );
}

export default Beranda;
